import Header from "../Header/Header";
import Menu from "../Menu/Menu";
import Routing from "../Routing/Routing";
import SuggestMeeting from "../";

import "./Layout.css";

function Layout(): JSX.Element {
    const teamId = 1;  // حدد الـ teamId اللي تريده أو خذها من حالة أو سياق التطبيق

    return (
        <div className="Layout">
			<Menu />
            <hr />
            <Header />
            
            {/* هنا نعرض الاقتراح */}
            <SuggestMeeting teamId={teamId} />
            
            <Routing />
        </div>
    );
}

export default Layout;
